import React from 'react';
import { NavLink } from 'react-router-dom';

const SignedInLinks = () => {
    var { path, pathName } = require('../../config/config');
    return (
        <ul className="right">
            <li><NavLink to={path.areas} className="waves-effect waves-light">Areas</NavLink></li>
            <li><NavLink to={path.crear_auditoria} className="waves-effect waves-light">Auditorias (temp)</NavLink></li>
            <li><NavLink to={path.crear_pregunta} className="waves-effect waves-light">Preguntas</NavLink></li>
        </ul>
    )
}

export default SignedInLinks;
